import React from 'react';

function Home(){
    return (
        <div className="accueil">
            <div className="frontView">
                <p>
                    <span>P</span><span>O</span><span>I</span><span>N</span><span>T</span>
                    <span>-</span>
                    <span>G</span><span>A</span><span>M</span><span>E</span>
                </p>
            </div>
            <div className="gameSelect">
                <div className="button Local">

                </div>
            </div>
        </div>
    );
}
export default Home;
